import { type ClassValue, clsx } from 'clsx';
import { twMerge } from 'tailwind-merge';

export function cn(...inputs: ClassValue[]) {
  return twMerge(clsx(inputs));
}

export function calcPercentageValue(size: string | number, percentage: number) {
  if (typeof size === 'number') {
    size = `${size}px`;
  }

  const match = size.match(/^(\d+(?:\.\d+)?)(\D+)?$/);
  if (!match) {
    throw new Error('Invalid size format');
  }

  const [, value, unit = 'px'] = match;
  const numericValue = parseFloat(value);

  const calculatedValue = numericValue * percentage;

  return `${calculatedValue.toFixed(2)}${unit}`;
}

